import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Header from "./Header";
import Content from "./Content";


class Main extends Component {
  render() {
    return (
      <BrowserRouter>
      <div>

        <Header />
        <Content />
      </div>
      </BrowserRouter>
    );
  }
}

export default Main;
